  reviewsText: '"My original title for this review: Extremely tiny. But does everything
    needed, and moreThe reviewers who complain that the product does not have Bass,
    Treble, and Balance controls have not read the manual, where the functions of
    the Option menu are detailed.A few months later, I am adding this to my review:
    I sure loved this little stereo, until I learned over time that the number of
    ordinary mass produced music CDs it can play is LESS than the number it cannot
    play. I have never before had a CD player that could not play ALL mass produced
    music CDs. More than half of the CDs I try, it makes several attempts to read
    them, then says Unknown disc and stops. The same CDs work in every other player
    I have."', reviewsTitle: Does not play most CDs, reviewsUsername: Kari Jackson,
